import json

from dominio.az_optipy.optipy import AzOptipy
from dominio.entity.documento import Documento
from dominio.readers.reader_base64 import Base64Reader
from dominio.readers.reader_img import ImgReader
from dominio.readers.reader_pdf import PDFReader
from dominio.readers.reader_txt import TxtReader
from infra.mensageria.publisher import Publisher

IP_ADDRESS_CONTAINER_RABBITMQ = '172.23.0.2'

NOME_EXCHANGE = 'ex_extracoes'
TAG_EXTRACOES = 'tag_extracoes'

publisher = Publisher(IP_ADDRESS_CONTAINER_RABBITMQ)
publisher.connect()
img_reader = ImgReader('../../dominio/arquivos_testes/trecho-livro.png')
az_optipy_imagem = AzOptipy(img_reader)
texto_extraido = az_optipy_imagem.precess_ocr()
documento_png = Documento(1, 6, texto_extraido)
documento_imagem_formato_json = json.dumps(documento_png.__dict__)
publisher.publish(NOME_EXCHANGE, TAG_EXTRACOES, documento_imagem_formato_json)

txt_reader = TxtReader('../../dominio/arquivos_testes/trecho_de_livro.txt')
az_optipy_imagem_base64 = AzOptipy(txt_reader)
texto_extraido_base64 = az_optipy_imagem_base64.precess_ocr()
documento_txt = Documento(2, 6, texto_extraido_base64)
documento_imagem_base64_formato_json = json.dumps(documento_txt.__dict__)
publisher.publish(NOME_EXCHANGE, TAG_EXTRACOES, documento_imagem_base64_formato_json)

pdf_reader = PDFReader('../../dominio/arquivos_testes/Undersampling.pdf')
az_optipy_pdf = AzOptipy(pdf_reader)
texto_extraido_pdf = az_optipy_pdf.precess_ocr()
documento_pdf = Documento(3, 6, texto_extraido_pdf)
documento_pdf_formato_json = json.dumps(documento_pdf.__dict__)
publisher.publish(NOME_EXCHANGE, TAG_EXTRACOES, documento_pdf_formato_json)


texto_base64 = 'data:image/png;base64,'


base64_reader = Base64Reader(texto_base64)
az_optipy_pdf = AzOptipy(pdf_reader)
texto_extraido_base64 = az_optipy_pdf.precess_ocr()
documento_base64 = Documento(4, 6, texto_extraido_base64)
documento_base64_formato_json = json.dumps(documento_base64.__dict__)
publisher.publish(NOME_EXCHANGE, TAG_EXTRACOES, documento_base64_formato_json)

publisher.close()
